                    <div className="col-md-6 col-12">Lorem ipsum dolor sit amet consectetur adipisicing elit. Expedita eum ut omnis distinctio amet corporis aliquam minima quod, debitis exercitationem qui illo quo ex error non impedit suscipit pariatur maiores!</div>
